selector_to_html = {"a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C99.png\"><img alt=\"../../media/3030C99.png\" src=\"../../media/3030C99.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Atraso infinito (Desativar mesma varredura de c\u00f3digo)</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#delay-1s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Atrasar 1s<a class=\"headerlink\" href=\"#delay-1s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#delay-5s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Atrasar 5s<a class=\"headerlink\" href=\"#delay-5s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#no-delay\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Sem atraso<a class=\"headerlink\" href=\"#no-delay\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C91.png\"><img alt=\"../../media/3030C91.png\" src=\"../../media/3030C91.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Atrasar 1s</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Escaneo<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modo de disparo de chaves<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pressione o bot\u00e3o para acionar a varredura e solte o bot\u00e3o para terminar a verifica\u00e7\u00e3o. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de leitura exceder o tempo de leitura \u00fanico.</p>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Detec\u00e7\u00e3o Autom\u00e1tica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>No modo de detec\u00e7\u00e3o autom\u00e1tica, o scanner detectar\u00e1 o brilho do ambiente ao redor. Quando o brilho muda, a varredura \u00e9 ativada. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de verifica\u00e7\u00e3o exceder o tempo de trabalho \u00fanico. Independentemente de a \u00faltima verifica\u00e7\u00e3o ter sido bem-sucedida ou falhada, o brilho do ambiente ao redor ser\u00e1 detectado novamente.</p>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C97.png\"><img alt=\"../../media/3030C97.png\" src=\"../../media/3030C97.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Atrasar 7s</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050204.png\"><img alt=\"../../media/2050204.png\" src=\"../../media/2050204.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modo cont\u00ednuo</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00f5es de Atraso de C\u00f3digo Mesmo<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>Para evitar que o mesmo c\u00f3digo de barras seja digitalizado v\u00e1rias vezes no <a class=\"reference internal\" href=\"#continuous-mode\">Modo Cont\u00ednuo</a> e <a class=\"reference internal\" href=\"#auto-sensing-mode\">Modo de Envio Autom\u00e1tico</a>, voc\u00ea pode exigir que o scanner espere por um atraso definido antes de permitir que o mesmo c\u00f3digo de barras seja escaneado.</p>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C95.png\"><img alt=\"../../media/3030C95.png\" src=\"../../media/3030C95.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Atrasar 5s</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C93.png\"><img alt=\"../../media/3030C93.png\" src=\"../../media/3030C93.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Atrasar 3 s</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C90.png\"><img alt=\"../../media/3030C90.png\" src=\"../../media/3030C90.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Sem atraso</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#infinite-delay-disable-same-code-scanning\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Atraso infinito (Desativar mesma varredura de c\u00f3digo)<a class=\"headerlink\" href=\"#infinite-delay-disable-same-code-scanning\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#delay-7s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Atrasar 7s<a class=\"headerlink\" href=\"#delay-7s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo cont\u00ednuo<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>O scanner funciona continuamente. Se a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de verifica\u00e7\u00e3o exceder o tempo de trabalho \u00fanico, a verifica\u00e7\u00e3o atual termina. Se o tempo exceder o tempo especificado, a pr\u00f3xima verifica\u00e7\u00e3o \u00e9 ativada automaticamente.</p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050209.png\"><img alt=\"../../media/2050209.png\" src=\"../../media/2050209.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modo de Detec\u00e7\u00e3o Autom\u00e1tica</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de disparo de chaves<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pressione o bot\u00e3o para acionar a varredura e solte o bot\u00e3o para terminar a verifica\u00e7\u00e3o. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de leitura exceder o tempo de leitura \u00fanico.</p>", "a[href=\"#delay-3s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Atrasar 3 s<a class=\"headerlink\" href=\"#delay-3s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050200.png\"><img alt=\"../../media/2050200.png\" src=\"../../media/2050200.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modo de disparo de teclas</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
